import React, { Component } from 'react'
import { PushNotificationWorker } from '../serviceWorkerConfig'
export default class Home extends Component {
  async componentDidMount() {
    const workerService = await navigator.serviceWorker.register('service-worker-push.js')
    console.log(workerService)
  }
  render() {
    return (
      <div>
        <h1>Home page</h1>
      </div>
    )
  }
}
